import React, {Component} from 'react';
import $ from 'jquery';
import Header from '../Header/Header.js';
import './profile.css';
import { Tab, Tabs, TabList, TabPanel } from 'react-tabs';


class Profile extends Component {
  constructor(props) {
    super(props);

    this.state = props.location.state;
    
  }



  componentDidMount() {
  }

  componentDidUpdate() {
  }


  render() {
    return (
      <div class="profile-container">
        <Header/>
        <div class="tabs-container">
          <Tabs>
            <TabList>
              <Tab>Profile</Tab>
            </TabList>

            <TabPanel>
              <div class="profile-details">
                <table>
                  <col width="200"/>
                  <col width="500"/>
                  <tbody>
                    <tr>
                      <td>Name</td>
                      <td></td>
                    </tr>
                    <tr>
                      <td>Designation</td>
                      <td></td>
                    </tr>
                    <tr>
                      <td>Skills</td>
                      <td></td>
                    </tr>
                    <tr>
                      <td>Email</td>
                      <td></td>
                    </tr>
                    <tr>
                      <td>Location</td>
                      <td></td>
                    </tr>
                  </tbody>
                </table>
              </div>
            </TabPanel>
          </Tabs>
        </div>
      </div>
    );
  }
}
export default Profile;
